import React from 'react'
import "./Header.css"

export default function Header() {
  return (
    <div className="header">
        <div className="headerTitles">
            <span className="headerTitleSm">Mr. Ingerson</span>
            <span className="headerTitleLg">Blogs</span>
        </div>

    </div>
  )
}
